SDK
This section contains all information about the sdk-related packages.

If you are looking to migrate from the sphere-node-sdk package, please read the migration guide.

Design architecture
The SDK is now split into multiple little packages, think about it as a microservice architecture. This is by choice and it provides several different advantages:

flexibility: choose the packages that fits best your use case
extensibility: developers can potentially build their own packages to extend / replace pieces of the SDK packages (e.g. custom middlewares)
maintainability: easier to maintain each single little package instead of one big library. This is also one of the reasons to use a monorepo

The core of the SDK lies within its middlewares implementation.
Middlewares do specific things and can be replaced by other middlewares depending on the use case, allowing many possible combinations.
The SDK client itself is in fact really simple and somehow even agnostic of the specific commercetools platform API that can be used as a generic HTTP client.
If we take a step back and look at the general requirement, at the end we simply want to execute a request. It just happens to be that we want to make specific requests to the commercetools platform API but it might be as well any other API. That's where the middlewares come in, which provide the side effects of the given request.
Usage example
In this example (integration test) we are going to make some requests to the /channels API endpoint. For that we need to be able to make actual requests (http middleware) as well as to authenticate the requests using the API Client Credentials Flow (auth middleware).
The queue middleware is not really necessary in this simple example but it is usually useful to limit a bit the number of concurrent requests.
The api-request-builder package comes in handy to easily construct the request URI but it is not really necessary as the URI could be also typed manually.
import { createRequestBuilder } from '@commercetools/api-request-builder'
import { createClient } from '@commercetools/sdk-client'
import {
  createAuthMiddlewareForClientCredentialsFlow,
} from '@commercetools/sdk-middleware-auth'
import {
  createHttpMiddleware,
} from '@commercetools/sdk-middleware-http'
import {
  createQueueMiddleware,
} from '@commercetools/sdk-middleware-queue'
import omit from 'lodash.omit'

const ignoredResponseKeys = [ 'id', 'createdAt', 'lastModifiedAt' ]

const service = createRequestBuilder().channels

const authMiddleware = createAuthMiddlewareForClientCredentialsFlow({
  host: 'https://auth.sphere.io',
  projectKey 'test',
  credentials: {
    clientId: '123',
    clientSecret: 'secret',
  },
})
const httpMiddleware = createHttpMiddleware({
  host: 'https://api.sphere.io',
})
const queueMiddleware = createQueueMiddleware({
  concurrency: 5,
})
const client = createClient({
  middlewares: [
    authMiddleware,
    httpMiddleware,
    queueMiddleware,
  ],
})

describe('Channels', () => {
  const key = uniqueId('channel_')
  let channelResponse

  it('create', () => {
    const body = {
      key,
      name: { en: key },
    }
    const createRequest = {
      uri: service.build({ projectKey }),
      method: 'POST',
      body,
      headers: {
        Accept: 'application/json',
        'Content-Type': 'application/json',
      },
    }

    return client.execute(createRequest)
    .then((response) => {
      channelResponse = response.body
      expect(omit(response.body, ignoredResponseKeys)).toEqual({
        ...body,
        roles: ['InventorySupply'],
        version: 1,
      })
      expect(response.statusCode).toBe(201)
    })
  })

  it('fetch', () => {
    const fetchRequest = {
      uri: service.where(`key = "${key}"`).build({ projectKey }),
      method: 'GET',
      headers: {
        Accept: 'application/json',
        'Content-Type': 'application/json',
      },
    }

    return client.execute(fetchRequest)
    .then((response) => {
      expect(response.body.results).toHaveLength(1)
      expect(response.statusCode).toBe(200)
    })
  })

  it('update', () => {
    const updateRequest = {
      uri: service.byId(channelResponse.id).build({ projectKey }),
      method: 'POST',
      body: {
        version: channelResponse.version,
        actions: [
          { action: 'addRoles', roles: ['OrderImport'] },
        ],
      },
      headers: {
        Accept: 'application/json',
        'Content-Type': 'application/json',
      },
    }

    return client.execute(updateRequest)
    .then((response) => {
      channelResponse = response.body
      expect(omit(response.body, ignoredResponseKeys)).toEqual({
        key,
        name: { en: key },
        roles: ['InventorySupply', 'OrderImport'],
        version: 2,
      })
      expect(response.statusCode).toBe(200)
    })
  })

  it('delete', () => {
    const uri = service.byId(channelResponse.id).build({ projectKey })
    const deleteRequest = {
      uri: `${uri}?version=${channelResponse.version}`,
      method: 'DELETE',
      headers: {
        Accept: 'application/json',
        'Content-Type': 'application/json',
      },
    }

    return client.execute(deleteRequest)
    .then((response) => {
      expect(response.statusCode).toBe(200)
    })
  })
})

let uniqueIdCounter = 0
function uniqueId (prefix) {
  const id = `${Date.now()}_${uniqueIdCounter}`
  uniqueIdCounter += 1
  return prefix ? prefix + id : id
}

sdk/upgrading-from-sphere-node-sdk.html.body:
Upgrading from sphere-node-sdk
If you're still using the sphere-node-sdk, this guide will help you migrating to the new SDK. Overall it's a completely new library, although some of APIs didn't change much.

The SDK officially supports node --version starting from 4.
Older versions might still work but we don't support them. Use them at your own risk or upgrade node version as well.

Table of Contents

Dependencies
Example migration


API differences
Sync actions
Request builder
SphereClient options


Implicit benefits
Auth flows
Always 100% compatibility with new API features



Dependencies
The SDK is not a single package anymore, it's composed of different packages.
It's up to you to pick only the packages that you need, many of them are optional and can also be replaced with custom implementations.

All new packages are now scoped to @commercetools. This is mainly to have better package names and to have them all under commercetools organization.

The core package is the @commercetools/sdk-client. Using it alone is useless, you need to provide at least a middleware (e.g. @commercetools/sdk-middleware-http).
If you aim to have all the functionalities of the sphere-node-sdk, you probably need the following packages:

@commercetools/sdk-client
@commercetools/sdk-middleware-auth
@commercetools/sdk-middleware-http
@commercetools/sdk-middleware-queue
@commercetools/sdk-middleware-logger
@commercetools/sdk-middleware-user-agent
@commercetools/api-request-builder
@commercetools/sync-actions

Example migration
// before
import SphereClient, { ProductSync } from 'sphere-node-sdk'
const client = new SphereClient({
  config: {
    project_key: 'my-project',
    client_id: '123',
    client_secret: 'secret',
  },
  user_agent: 'sphere-node-sdk',
  host: 'api.sphere.io',
  protocol: 'https',
  oauth_host: 'auth.sphere.io',
  oauth_protocol: 'https',
})
const sync = new ProductSync()
const updateActions = sync.buildActions(/* newProduct, existingProduct */)
client.products
  .byId('1')
  .expand('productType')
  .update({ version: 1, actions: updateActions })
  .then(/* result */)
  .catch(/* error */)


// after
import { createClient } from '@commercetools/sdk-client'
import { createAuthMiddlewareForClientCredentialsFlow } from '@commercetools/sdk-middleware-auth'
import { createHttpMiddleware } from '@commercetools/sdk-middleware-http'
import { createQueueMiddleware } from '@commercetools/sdk-middleware-queue'
import { createUserAgentMiddleware } from '@commercetools/sdk-middleware-user-agent'
import { createRequestBuilder } from '@commercetools/api-request-builder'
import { createSyncProducts } from '@commercetools/sync-actions'

const client = createClient({
  // The order of the middlewares is important !!!
  middlewares: [
    createAuthMiddlewareForClientCredentialsFlow({
      host: 'https://auth.sphere.io',
      projectKey: 'my-project',
      credentials: {
        clientId: '123',
        clientSecret: 'secret',
      },
    }),
    createQueueMiddleware({ concurrency: 10 }),
    createHttpMiddleware({ host: 'https://api.sphere.io' }),
    createHttpUserAgent({
      libraryName: 'my-library',
      libraryVersion: '1.0.0',
      contactUrl: 'https://github.com/commercetools/nodejs',
      contactEmail: 'npmjs@commercetools.com',
    }),
  ],
})
const service = createRequestBuilder().products
const uri = service
  .byId('1')
  .expand('productType')
  .build({ projectKey: 'my-project' })
const sync = createSyncProducts()
const updateActions = sync.buildActions(/* newProduct, existingProduct */)
const updateRequest = {
  uri,
  method: 'POST',
  body: { version: 1, actions: updateActions },
}
client.execute(updateRequest)
  .then(/* result */)
  .catch(/* error */)

API differences
Sync actions
In the sphere-node-sdk the sync utils were exported within the same package.
In the new SDK they are scoped in their own module and they implement only 1 main function: buildActions.
// before
import { ProductSync } from 'sphere-node-sdk'
const sync = new ProductSync()
const payload = sync.buildActions(...).getUpdatePayload()

// after
import { createSyncProducts } from '@commercetools/sync-actions'
const sync = createSyncProducts()
const actions = sync.buildActions(...)
const payload = { version: 1, actions }

Request builder
In the sphere-node-sdk you were building the request for each service by chaining different commands and executing fetch, update, etc at the end.
In the new SDK, we saw that the sdk-client simply accepts a request object. The uri parameter can be simply defined manually or can be generated using the request builder. This has basically the same API as the sphere-node-sdk.
// before
import SphereClient from 'sphere-node-sdk'
const client = new SphereClient({ config: { projectKey: 'my-project' } })
client.channels.perPage(10).fetch()


// after
import { createClient } from '@commercetools/sdk-client'
import { createRequestBuilder } from '@commercetools/api-request-builder'
const client = createClient({ middlewares: [...] })
client.execute({
  // manually define the request URI
  uri: '/my-project/channels?limit=10',
  method: 'GET',
})

const channels = createRequestBuilder().channels
client.execute({
  // define the request URI using the request builder
  uri: channels.perPage(10).build({ projectKey: 'my-project' }),
  method: 'GET',
})

Additionally, all services provided by the request builder are defined using features. This allows to configure a service with only the features or functions that the service supports.
The package allows also to pass custom services.
import {
  createRequestBuilder,
  features,
} from '@commercetools/api-request-builder'
const customServices = {
  users: {
    type: 'users',
    endpoint: '/users',
    features: [
      features.query,
      features.queryOne,
    ],
  },
}
const requestBuilder = createRequestBuilder(customServices)
requestBuilder.users.byId('1').build()

SphereClient options
In the sphere-node-sdk all sorts of configuration options were passed as a big object to the SphereClient contructor.
In the new SDK all those options are split across the middlewares. See example above.
Implicit benefits
Auth flows
In the sphere-node-sdk the way of getting an access_token was restricted to the client credentials flow and it wasn't possible to define the scopes for the token.
In the new SDK, because of the flexibility that the middlewares provide, it's possible to have all sorts of different auth flows.
Always 100% compatibility with new API features
In the sphere-node-sdk requests for a service had to be defined using the methods that the service provided. If the commercetools HTTP API would release new endpoints or new request options, the SDK had to be adjusted in order to support those new features.
In the new SDK this problem becomes obsolete because the request URI can simply be provided manually. The request builder is just a helper to construct the URI for a given service but the URI can be typed manually as well.
client.execute({
  uri: '/my-project/some-new-endpoint?wow=this-is-a-new-query-option',
})

sdk/Testing.html.body:
Testing
If you are testing a library or a project that uses the SDK underneath, you probably don't want to make actual HTTP requests (unless you are doing integration tests).
Mock requests with nock (recommended)
There are several approaches to mock the requests, the easiest one we recommend to use is the nock library.
This library allows to deeply customize how you want to mock the actual node http.request and it's very declarative, making it easy to use. Let's see an example:
// We'll mock a request to fetch some products
nock('https://api.sphere.io')
  .defaultReplyHeaders({ 'Content-Type': 'application/json' })
  .get('/my-project/products')
  .reply(
    200,
    {
      total: 2,
      count: 2,
      results: [{ id: '1' }, { id: '2' }],
    }
  )

// or mock a request to create a channel
nock('https://api.sphere.io')
  .defaultReplyHeaders({ 'Content-Type': 'application/json' })
  .filteringRequestBody(() => '*')
  .post('/my-project/channels', '*')
  .reply(201, { id: '1' })

// we could also do assertions on the body payload
.filteringRequestBody((body) => {
  expect(body).toBe(JSON.stringify({ foo: 'bar' }))
  return '*'
})

// Note that by default the defined mocks (or interceptors) are used only once
// https://github.com/node-nock/nock#read-this---about-interceptors
// To re-use the same interceptor for multiple requests simply call `persist()`
// https://github.com/node-nock/nock#persist

Mock middlewares
Another approach would be to provide a http-mock middleware that replaces the e.g. http middleware. It's a bit more work in terms of configuring the middleware for mocking different requests but it might be simpler for mocking requests in general and not caring about the response.
import { getErrorByCode } from '@commercetools/sdk-middleware-http'
const BadRequest = getErrorByCode(400)
const httpMockSuccessMiddleware = next => (request, response) => {
  next(request, { ...response, body: { foo: 'bar' } })
}
const httpMockFailureMiddleware = next => (request, response) => {
  next(request, { ...response, error: new BadRequest('Invalid field') })
}
const client = createClient({
  middlewares: [
    authMiddleware,
    httpMockSuccessMiddleware,
    // httpMockFailureMiddleware,
  ],
})

Mock modules
Furthermore, if you're using jest for testing, you might decide to define manual mocks for the SDK modules. You might think of using this if you just want to mock the SDK modules altogether.
// Note: once this PR is released (https://github.com/facebook/jest/pull/2483),
// setting up the mock can be done in
//   __mocks__/@commercetools/sdk-client.js
jest.mock('@commercetools/sdk-client', () =>
  () => ({ execute: jest.fn(() => Promise.resolve('Hello')) }),
)

const createClient = require('@commercetools/sdk-client')

const client = createClient()

function testImplementation (request, cb) {
  client.execute(request)
  .then(result => cb(null, result))
  .catch(error => cb(error))
}

describe('SDK client', () => {
  it('use mocked version', () =>
    new Promise((resolve, reject) => {
      testImplementation({ uri: '/foo/bar' }, (error, data) => {
        if (error) {
          reject(error)
          return
        }
        expect(client.execute).toHaveBeenLastCalledWith({ uri: '/foo/bar' })
        expect(data).toBe('Hello')
        resolve()
      })
    }),
  )
})

sdk/Glossary.html.body:
Glossary
This is a glossary of the core terms around SDK packages, along with their type signatures. The types are documented using Flow notation.
ClientRequest
type ClientRequest = {
  uri: string;
  method: MethodType;
  body?: string | Object;
  headers?: {
    [key: string]: string;
  }
}

A ClientRequest is an object describing the request that needs to be executed by the sdk-client. This is also the signature of the request object passed to a middleware.
ClientResponse
type ClientResponse = {
  resolve(): void;
  reject(): void;
  body?: Object;
  error?: HttpErrorType;
  statusCode: number;
}

A ClientResponse is an object describing the response object passed to a middleware.
Middleware
type Dispatch = (request: ClientRequest, response: ClientResponse) => any;
type Middleware = (next: Dispatch) => Dispatch;

A Middleware is a higher-order function that composes a dispatch function to return a new dispatch function.
Middleware is composable using function composition. It is used for authentication, making http requests, logging requests, etc. See section about middlewares for more information.
Client
type Client = {
  execute: (request: ClientRequest) => Promise;
}

A Client is an object that contains functions to work with HTTP requests.  

execute(request) is the main function to use for doing HTTP requests, using the provided middlewares.

ClientResult
type ClientResult = {
  body: ?Object;
  statusCode: number;
} | HttpErrorType

A ClientResult is the object returned by execute, depending if the response was resolved or rejected.
HttpErrorType
type HttpErrorType = {
  name: string;
  message: string;
  code: number;
  status: number;
  statusCode: number;
  body: Object;
  originalRequest: ClientRequest;
  headers?: {
    [key: string]: string;
  }
}

A HttpErrorType describes the shape of the error rejected by execute. The error is typed (e.g. BadRequest, Unauthorized) and contains useful meta information to help debug the cause of the error.
SyncAction
type UpdateAction = {
  action: string;
  [key: string]: any;
}
type SyncAction = {
  buildActions: (before: Object, now: Object) => Array;
}

type ActionGroup = {
  type: string;
  group: 'black' | 'white';
}

sdk/api/sdkClient.html.body:
sdk-client
Core package to enable executing HTTP request. To be used together with middlewares.
Install
Node.js
npm install --save @commercetools/sdk-client

Browser

// global: CommercetoolsSdkClient

createClient(options)
Creates a client instance.
Named arguments (options)

middlewares (Array): A list of middlewares to be used within this client. The order of the middlewares is really important! (e.g. it does not make sense to put the http middleware before the auth middleware).

Client API
execute(request)
Returns a Promise which gets resolved after all the provided middlewares have done their job with the given request / response. This is the primary method to use.

request (Object): A request object

Usage example
import { createClient } from '@commercetools/sdk-client'
import { createHttpMiddleware } from '@commercetools/sdk-middleware-http'

const client = createClient({
  middlewares: [
    createHttpMiddleware(),
  ],
})
const request = {
  uri: '/foo/bar',
  method: 'GET',
  headers: {
    Authorization: 'Bearer xxx',
  },
}

client.execute(request)
.then(result => ...)
.catch(error => ...)

process(request, processFn, options)
This function should be used to iterate through all the pages of a HTTP Rest API endpoint. Given the request object, the first page result of the request query will be passed to the processFn. This function does whatever it needs to do with the data and returns itself a promise which will trigger fetching a new page. This goes on and on until all available pages of the request query have being fetched and processed.
Returns a Promise with the accumulated result of each processFn calls.

request (Object): A request object
processFn (Function): A function that gets called on each API page iteration. The function gets as an argument the response of the API request and should return a Promise which will trigger the next iteration.
options (Object)
accumulate (Boolean): (default true) a flag to indicate whether all the results of the iterations should be accumulated. This is useful if you want to e.g. fetch all the entities of an API endpoint and do something with it at the end. Be careful that this might lead to memory problems if the fetched data gets too big. If it's not necessary to have all the data when the process function resolves, it's recommended to disable this option.



Usage example
import { createClient } from '@commercetools/sdk-client'
import { createHttpMiddleware } from '@commercetools/sdk-middleware-http'
import { createRequestBuilder } from '@commercetools/api-request-builder'

const requestBuilder = createRequestBuilder()
const productProjectionsService = requestBuilder.productProjections
const productsService = requestBuilder.products

const client = createClient({
  middlewares: [
    createHttpMiddleware(),
  ],
})
const uri = productProjectionsService
  .where('masterData(published = "false")')
  .where('masterData(hasStagedChanges = "true")')
  .build({ projectKey: 'foo' })

const request = {
  uri,
  method: 'GET',
  headers: {
    Authorization: 'Bearer xxx',
  },
}

// 1. We want to publish all products that are not published yet
client.process(
  request,
  (payload) => {
    const results = payload.body.results
    return Promise.all(
      results.map(product =>
        client.execute({
          uri: productsService.byId(product.id).build({ projectKey: 'foo' }),
          method: 'POST',
          body: JSON.stringify({
            version: product.version,
            actions: [{ action: 'publish' }]
          }),
          headers: request.headers,
        })
      ),
    )
  },
  { accumulate: false },
)
.then(result => ...)
.catch(error => ...)

